function Wee(e){if(typeof e==="string"){var t=document.querySelectorAll(e);this.collection=Array.prototype.slice.call(t)}else if(e.nodeType){this.collection=Array.prototype.slice.call({0:e,length:1})}return this}Wee.prototype={length:function(){return this.collection.length},each:function(e){Array.prototype.forEach.call(this.collection,e)},on:function(t,o){return this.each(function(e){e.addEventListener(t,o)})},ready:function(e){document.addEventListener("DOMContentLoaded",e)}};function $(e){return new Wee(e)}for(var key in Wee.prototype){if(Object.prototype.hasOwnProperty.call(Wee.prototype,key)){$[key]=Wee.prototype[key]}}